import React from "react";
import {
  Card,
  CardHeader,
  CardBody,
  Container,
  Row,
  Col,
  Button
} from "reactstrap";
import Header from "components/Headers/Header.jsx";
import Step from ".examples/Step";
const line = {
  width: "2px",
  height: "100px",
  background: "black"
};

class Index extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      step: true
    };
  }

  choose(value) {
    if (this.state.step === true) {
      return <Step />;
    } else {
      window.location = "identify";
    }
  }

  render() {
    return (
      <>
        <Header />
        {this.choose()}
      </>
    );
  }
}

export default Index;
